import React, { Component } from "react";
import "../components/upload/upload.css";
import { Switch, Route, Link } from "react-router-dom";

import UploadPhoto from "../components/upload/UploadPhoto";

class UploadPage extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Switch>
          <Route path="/dashboard/upload/photo" component={UploadPhoto} />

          <div id="uploadHubWrapper">
            <div>
              <span className="uploadHubHeader">Choose your upload method</span>
            </div>
            <div className="uploadHubLink">
              <Link to="/dashboard/upload/photo">From photo</Link>
            </div>
          </div>
        </Switch>
      </React.Fragment>
    );
  }
}

export default UploadPage;
